import { useState } from 'react';
import { 
  Grid, TextField, InputAdornment, Chip, Card, CardContent, Typography, 
  IconButton, Button, Paper
} from '@mui/material';
import {
  Search, BarChart, EventSeat, Theaters
} from '@mui/icons-material';

const AdminDashboard = () => {
  const [selectedSeats, setSelectedSeats] = useState([]);

  // Mock seat data
  const seats = [
    { id: 'A1', type: 'VIP', price: 1200, available: true },
    { id: 'A2', type: 'VIP', price: 1200, available: false },
    { id: 'B1', type: 'Regular', price: 800, available: true },
    // ... more seats
  ];

  const handleSeatSelect = (seat) => {
    if(!seat.available) return;
    setSelectedSeats(prev => 
      prev.some(s => s.id === seat.id) 
        ? prev.filter(s => s.id !== seat.id)
        : [...prev, seat]
    );
  };

  const calculateTotal = () => 
    selectedSeats.reduce((sum, seat) => sum + seat.price, 0);

  return (
    <div style={{ padding: '24px' }}>
      {/* Search & Filters */}
      <TextField
        fullWidth
        placeholder="Search movies, events, cinemas..."
        InputProps={{
          startAdornment: (
            <InputAdornment position="start">
              <Search />
            </InputAdornment>
          ),
        }}
        sx={{ mb: 4 }}
      />

      <div style={{ marginBottom: '24px' }}>
        <Chip label="VIP Seats" variant="outlined" sx={{ mr: 1 }} />
        <Chip label="Regular Seats" variant="outlined" sx={{ mr: 1 }} />
        <Chip label="All Seats" variant="outlined" />
      </div>

      {/* Metrics Row */}
      <Grid container spacing={3} sx={{ mb: 4 }}>
        <Grid item xs={12} sm={6} md={3}>
          <MetricCard 
            title="Total Bookings"
            value="2,456"
            icon={<EventSeat fontSize="large" />}
            progress={75}
          />
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <MetricCard
            title="Active Shows"
            value="148"
            icon={<Theaters fontSize="large" />}
            trend="+12%"
          />
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <MetricCard
            title="Total Revenue"
            value="$45,230"
            icon={<BarChart fontSize="large" />}
            currency
          />
        </Grid>
      </Grid>

      {/* Main Content */}
      <Grid container spacing={3}>
        {/* Seat Selection */}
        <Grid item xs={12} md={8}>
          <Card elevation={3}>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Seat Selection
              </Typography>
              <Grid container spacing={1} sx={{ mt: 2 }}>
                {seats.map(seat => (
                  <Grid item xs={2} key={seat.id}>
                    <IconButton
                      color={seat.available ? "primary" : "error"}
                      disabled={!seat.available}
                      onClick={() => handleSeatSelect(seat)}
                    >
                      <EventSeat fontSize="large" />
                    </IconButton>
                    <Typography variant="caption" display="block">
                      {seat.id} - ₹{seat.price}
                    </Typography>
                  </Grid>
                ))}
              </Grid>
            </CardContent>
          </Card>
        </Grid>

        {/* Booking Summary */}
        <Grid item xs={12} md={4}>
          <Card elevation={3}>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Booking Summary
              </Typography>
              {selectedSeats.map(seat => (
                <div key={seat.id}>
                  {seat.id} - ₹{seat.price}
                </div>
              ))}
              <Typography variant="h6" sx={{ mt: 2 }}>
                Total: ₹{calculateTotal()}
              </Typography>
              <Button 
                variant="contained" 
                fullWidth 
                sx={{ mt: 2 }}
                disabled={selectedSeats.length === 0}
              >
                Confirm Booking
              </Button>
            </CardContent>
          </Card>
        </Grid>
      </Grid>
    </div>
  );
};

// MetricCard component remains same
const MetricCard = ({ title, value, icon, progress, trend }) => (
  <Card elevation={3}>
    <CardContent>
      <div style={{ display: 'flex', alignItems: 'center', gap: '16px' }}>
        <div style={{ color: '#1976d2' }}>{icon}</div>
        <div>
          <Typography variant="h5">{value}</Typography>
          <Typography variant="subtitle2" color="textSecondary">
            {title}
          </Typography>
          {progress && (
            <div style={{ marginTop: '8px', width: '100%', height: '8px', backgroundColor: '#eee', borderRadius: '4px' }}>
              <div style={{ 
                width: `${progress}%`, 
                height: '100%', 
                backgroundColor: '#4caf50',
                borderRadius: '4px'
              }} />
            </div>
          )}
          {trend && <span style={{ color: trend.startsWith('+') ? '#4caf50' : '#f44336' }}>{trend}</span>}
        </div>
      </div>
    </CardContent>
  </Card>
);

export default AdminDashboard;
